import numpy as npimport pandas as pdimport matplotlib.pyplot as pltimport seaborn as snssns.set_style("whitegrid")def GetData(ticker, start="2000-01-01", end = "2019-09-01"):    import yfinance as yf        Ticker = yf.Ticker(ticker)    df = pd.DataFrame(Ticker.history(start=start))        # Calculate Sigma, Returns, Indices - Adjusted data    df["Sigma"] = np.log( df["High"] / df["Low"] )    df["Return"] = df["Close"].pct_change()    df["LnClose"] = np.log(df["Close"])    return(df)UIs = ["^GSPC","^DJI","^IXIC","^NYA","^RUT","^FTSE","^GDAXI","^STOXX50E",       "^N100","^N225","^HSI","000001.SS","^STI","^AORD","^BSESN","^MXX",       "^MERV","^CASE30"]data_ui = [GetData(i) for i in UIs]for i, ui in enumerate(data_ui):    # Print Min Date    print(data_ui[i].index[0])        # plot    plt.figure()    data_ui[i]["Close"].plot()    plt.show();    